import React from 'react';
import { useNavigate } from 'react-router-dom';
import Card from './Card';

export default function SGODashboard() {
  const navigate = useNavigate();

  const addCSOPage = () => {
    navigate('/addCSO');
  }

  function cards() {
    return (
       <>
        <Card 
          imageUrl="../images/clubs.png" 
          description="Students"
        />
        
        <Card 
          imageUrl="../images/clubs.png" 
          description="Executives"
        />
        
        <Card 
          imageUrl="../images/clubs.png" 
          description="CSOs"
        />
      </>
    );
  }

  return (
    <main>
      <h1>SGO Dashboard</h1>
      <p>Welcome, SGO member! Here you can manage clubs, approve events, and view student activities.</p>
      <button onClick={addCSOPage}>Add CSO</button>

      {/* Example usage of cards() to remove warning */}
      {cards()}
    </main>
  );
}
